platform.apiLevel= "1.0"

screen = 0
meteorit = {}
missile = {}
levels = {}
timeint = 0.1
answer = ""
level = 0
menu = 0
meteorit_a = 0

width = platform.window:width()
height = platform.window:height()

temptime = 0

function on.create()
levels[1]={
  zeit_dif = 10,
  gegner = 1,
  boss = 0,
  speed_a = 2,
  speed_boss = 1,
  speed_missile = 10,
  missile_count = 1,
  qu_easy={10,100},
  qu_hard={5,10}
}

setLevel()

end

function on.charIn(char)
  if screen == 1 then
    answer = answer + char
  end
end

function on.backspaceKey()
  if screen == 1 then
    answer = deletelastchar(answer)
  end
end

function on.paint(gc)
  if screen == 0 then
  	paint_back(gc)
  	paint(gc)
  	gc:setColorRGB(255,255,255)
  	gc:setFont("sansserif","r",24)
  	gc:drawString("Mathe-Shooter",120,30,"baseline")
  	gc:setFont("sansserif","i",10)
  	gc:drawString("Programmiert von Pascal Maximilian Bremer",20,200,"baseline")
  	gc:setFont("sansserif","i",12)
  	gc:setColorRGB(50,205,50)
  	gc:drawString("[1] Spiel starten",platform.window:width()/2-50,60,"middle")
  	gc:drawString("[2] Hilfe",platform.window:width()/2-50,90,"middle")
  	gc:drawString("[3] eigenes Level",platform.window:width()/2-50,120,"middle")
  	gc:setColorRGB(255,255,255)
  	gc:setFont("sansserif","i",10)
  	gc:drawString("mit [Tab] können Sie jederzeit ins Menü wechseln",platform.window:width()/2-140,160,"middle")	
  end
end

function setLevel()
  answer= ""
  meteorit_a= 0
  meteorit = {}
  temptime = 0
  timer.start(timeint)
end

function paint_back(gc)
  gc:setColorRGB(0,0,0)
  gc:fillRect(0,0,platform.window:width(),platform.window:height())
end

function createMeteorit(x,y,boss)
  h = -1
  if meteorit_a > 0 then
    for i = 1, meteorit_a do
      if meteorit[i].aktiv == false then
        h = i
        break
      end
    end
  end
  
  if h == -1 then
    meteorit_a = meteorit_a +1
    h= meteorit_a    
  end 
  
  if ((math.random(10)<> 3) and (levels[level].boss < levels[level].gegner) and (levels[level].gegner > 0)) or (boss == false) then
    meteorit[h] = {
    	groesse = 35,
    	aktiv = true,
    	level = 1
    }
    
    if boss == true then
    	meteorit[h].PosX = math.random(width - 60) +17
    	meteorit[h].PosY = -35
    else
      meteorit[h].PosX = x
      meteorit[h].PosY = y
    end
    
    meteorit[h].animate = 1
    meteorit[h].explosion = 0
    meteorit[h].qa = get_qa(levels[level].qa_easy[1],levels[level].qa_easy[2],levels[level].qa_easy[1],levels[level].qa_easy[2],math.random(0,1))
    
    if boss == true then
    levels[level].gegner = levels[level].gegner -1
    end       
  elseif levels[level].boss > 0 then
  	meteorit[h]= {
  		groesse = 50,
  		aktiv = true,
  		explosion = 0,
  		level = 2,
  		PosX = random(width-100)+50,
  		PosY = -50,
  		animate = 1,
  		qa = get_qa(levels[level].qa_hard[1],levels[level].qa_hard[2]levels[level].qa_hard[1],levels[level].qa_hard[2],math.random(2,3))
  	}  
  end
  
end

function get_qa(z1,z2,op)
  qa = {}
  
  if op == 0 then
    qa.question = tostring(z1)+ "+" +tostring(z2)
    qa.answer = z1 + z2  
  elseif op == 1 then
  	qa.question = tostring(z1)+ "-" +tostring(z2)
  	qa.answer = z1 - z2 
  elseif op == 2 then
    qa.question = tostring(z1)+ "*" +tostring(z2)
    qa.answer = z1*z2
  else
  	z2 = z1*z2
  	
  	qa.question = tostring(z2) + "/" + tostring(z1)
  	qa.answer = z2 / z1
  end
  
  return qa
end

function on.timer()
  if temptime == 0 then
  	createMeteorit(0,0,true)
  end
end

function paint(gc)
  for i= 1, meteorit_a do
  	if meteorit[i].aktiv == true then
  	  if meteorit[i].explosion > 0 then
  	  	gc:drawImage(img_exp[meteorit[i].explosion],meteorit[i].PosX,meteorit[i].PosY)
      	if meteorit[i].explosion == 5 then
      		meteorit[i].aktiv = false
      	else
      	  meteorit[i].explosion = meteorit[i].explosion
      	end
      else
      	if meteorit[i].level == 1 then
      		gc:drawImage(img_met[meteorit[i].animate],meteorit[i].PosX,meteorit[i].PosY)
      	else
      	  tempimg = img_met[meteorit[i].animate]
      	  tempimg = image:copy(70,70)
      	  gc:drawImage(tempimg,meteorit[i].PosX,meteorit[i].PosY)
      	end
      	
      	if meteorit[i].animate == 30 then
      		meteorit[i].animate = 1
      	else
      		meteorit[i].animate = meteorit[i].animate +1	
      	end
        gc:setFont("sansserif","b",20)
        gc:drawString(meteorit[i].qa.question,meteorit[i].PosX,meteorit[i].PosY)
      end   	
   	end
  end
end

function bewege()
	--Meteorit
	if meteorit_a > 0 then
	  for i = 1 to meteorit_a do
	  	if (meteorit[i].aktiv) and (meteorit[i].explosion = 0) then
	  	  meteorit[i].PosY = meteorit[i].PosY + math.random(levels[level].speed_a)
	  	end
	  end
	end  
end

function on.enterKey()
end

function on.tabKey()
  timer.stop()
  screen = 0
  setlevel()
end

function deletelastchar(s)
  news = ""
  for i= 1, string.len(s)-1 do
  	news = news .. string.char(string.byte(s,i))
  end
  return news
end


